exports=async function(bid,options){const{parseCatalogPaginate,getSelectLastOptionSubRegex}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`https://www.qvdudu.net/book/${bid.idPrefix()}/${bid}${1===page?"":"_"+page}/`,".section-list",{...options,clientOptions,pageSize:20,totalPagesRegex:html=>getSelectLastOptionSubRegex(html,/\/book\/\d+\/\d+_(\d+)\//)?.intValue()})};